import React, { useState } from "react";
import { Box, MenuItem, Select, InputLabel, FormControl, Button, TextField, Card, Typography } from "@mui/material";

function App() {
  const [inputType, setInputType] = useState("");  // Track selected type
  const [file, setFile] = useState(null);          // Store selected file
  const [url, setUrl] = useState("");              // Store URL input
  const [preview, setPreview] = useState("");      // For previewing the image or file

  const handleInputChange = (event) => {
    setInputType(event.target.value);
    setFile(null); // Reset file when the input type changes
    setUrl("");    // Reset URL when the input type changes
    setPreview("");
  };

  // Handle file upload (PDF or Image)
  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);

    // For image preview
    if (inputType === "image") {
      const imageUrl = URL.createObjectURL(selectedFile);
      setPreview(imageUrl);
    }
  };

  // Handle URL input
  const handleUrlChange = (event) => {
    setUrl(event.target.value);
    setPreview(event.target.value);
  };

  // Handle the Generate button click
  const handleGenerate = () => {
    if (inputType === "pdf" && file) {
      alert(`PDF file "${file.name}" uploaded successfully.`);
    } else if (inputType === "url" && url) {
      alert(`URL "${url}" submitted successfully.`);
    } else if (inputType === "image" && file) {
      alert(`Image "${file.name}" uploaded successfully.`);
    } else {
      alert("Please upload a file or enter a URL.");
    }
  };

  return (
    <Box sx={{ padding: 4, maxWidth: 600, margin: 'auto', mt: 4 }}>
      <Card variant="outlined" sx={{ padding: 3 }}>
        <Typography variant="h4" gutterBottom>
          Import File or URL
        </Typography>

        {/* Dropdown for file selection */}
        <FormControl fullWidth sx={{ mb: 3 }}>
          <InputLabel>Select Input Type</InputLabel>
          <Select
            value={inputType}
            label="Select Input Type"
            onChange={handleInputChange}
          >
            <MenuItem value="">-- Choose One --</MenuItem>
            <MenuItem value="pdf">PDF File</MenuItem>
            <MenuItem value="url">Website URL</MenuItem>
            <MenuItem value="image">Image File (PNG, JPG, JPEG)</MenuItem>
          </Select>
        </FormControl>

        {/* Conditional rendering based on the selected type */}
        {inputType === "pdf" && (
          <Box>
            <Button
              variant="contained"
              component="label"
              fullWidth
              sx={{ mb: 2 }}
            >
              Upload PDF
              <input
                type="file"
                hidden
                accept="application/pdf"
                onChange={handleFileChange}
              />
            </Button>
            {file && <Typography>PDF Uploaded: {file.name}</Typography>}
          </Box>
        )}

        {inputType === "url" && (
          <Box>
            <TextField
              label="Enter Website URL"
              variant="outlined"
              fullWidth
              value={url}
              onChange={handleUrlChange}
              placeholder="https://example.com"
              sx={{ mb: 2 }}
            />
            {url && (
              <Typography>
                URL Entered: <a href={url} target="_blank" rel="noopener noreferrer">{url}</a>
              </Typography>
            )}
          </Box>
        )}

        {inputType === "image" && (
          <Box>
            <Button
              variant="contained"
              component="label"
              fullWidth
              sx={{ mb: 2 }}
            >
              Upload Image (PNG, JPG, JPEG)
              <input
                type="file"
                hidden
                accept="image/png, image/jpeg"
                onChange={handleFileChange}
              />
            </Button>
            {preview && (
              <Box>
                <Typography>Image Preview:</Typography>
                <img src={preview} alt="Preview" style={{ width: '100%', maxHeight: '400px', objectFit: 'cover' }} />
              </Box>
            )}
          </Box>
        )}

        {/* Generate Button */}
        <Box sx={{ mt: 4 }}>
          <Button
            variant="contained"
            color="primary"
            fullWidth
            onClick={handleGenerate}
          >
            Generate
          </Button>
        </Box>
      </Card>
    </Box>
  );
}

export default App;
